import React, {useState, useEffect} from 'react';
import styled from 'styled-components';

const OuterCon = styled.div`
    display: flex;
    flex-direction: column;
    width: 100vw;
    height: 100vh;
`
const InnerCon = styled.div`
    display: flex;
    flex-direction: column;
    width: 100vw;
    height: 100vh;
    background-color: red;
    margin: 10% 5% 10% 5%;
`

function About() {

    return(
        <OuterCon>
            <InnerCon>
                Hello world
            </InnerCon>
        </OuterCon>
    );
}

export default About
